  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Waubay
  National Wildlife Refuge and Wetland Management District outlines Refuge accomplishments
  during the 1997 calendar year. The report begins with a summary of the year's highlights
  and climatic conditions. Refuge administration is outlined; information about personnel,
  volunteer programs, funding, safety, and technical assistance is given. Habitat
  management is also covered; subjects include wetlands, forests, croplands, grazing,
  haying, pest control, water rights and wilderness and special areas. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, other migratory birds, game mammals, other resident wildlife, fisheries
  resources, animal control, and marking and banding. The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive exhibits, hunting,
  wildlife observation, other wildlife oriented recreation, picnicking, and law enforcement.
  The equipment and facilities section of the report provides information about major
  maintenance, equipment utilization and replacement, communications systems, and
  computer systems. Items of interest are provided at the end. Photographs are attached.\",\n\t\"license_title\":
